int *mapping;
float **graph;
float *total_comm;
float maxima = 0;
void allocate_memory(int No_nodes)
{
    unsigned short index;
    //mapping = (int*)malloc(No_nodes*sizeof(float*));
    graph=(float**)malloc(No_nodes*sizeof(float*));
    for(index=0;index<No_nodes;index++)
    {
        graph[index]=(float*)malloc(No_nodes*sizeof(float));
    }
    return;
}
void intialize_graph(const char* graph_file,const char* mapping_file,int No_nodes)
{   allocate_memory(No_nodes);
    total_comm = (float*)calloc(No_nodes,sizeof(float));
    unsigned short nodes,row=0,colum=0,cores;
    char*buff;
    int i;
    //ifstream file_map;
    ifstream file_graph;
    //file_map.open(mapping_file);
    file_graph.open(graph_file);
    buff=new char [5];
        file_graph>>nodes;
        cores=nodes;
        //cout<<nodes<<endl;
        
        for(row=0;row<No_nodes;row++)
        {   total_comm[row] = 0;
        	for(colum=0;colum<No_nodes;colum++)
        	{
        		graph[row][colum]=0;
        	}
        }
        file_graph>>buff;
        row=0;
        colum=0;
        while(row<cores)
        {   
            if(strcmp(buff,"INF")==0)
            {
                graph[row][colum]=0;
                if(graph[row][colum]>maxima)
                {
            	maxima = graph[row][colum];
                }
                //out<<"0";
                colum++;
               // cout<<"here";
            }
            else
            {
                graph[row][colum]=atof(buff);
                if(graph[row][colum]>maxima)
                {
            	maxima = graph[row][colum];
                }
                total_comm[row] = total_comm[row] + graph[row][colum];
                colum++;
            }
            
            if(colum>=nodes)
            {   //out<<"},{"
                colum=0;
                row++;
            }
            
            file_graph>>buff;
        }
        /*cout<<"Graph\n";
        for(row=0;row<No_nodes;row++)
        {   //total_comm[row] = 0;
        	for(colum=0;colum<No_nodes;colum++)
        	{
        		cout<<graph[row][colum]<<"\t";
        	}
        	cout<<"\n";
        }
        cout<<"Mapping\n";*/
        /*for(i=0;i<No_nodes;i++)
        {
            file_map>>mapping[i];
            //cout<<mapping[i]<<"\t";
        }*/
        //cout<<"\n Max_comm = "<<maxima<<"\n";
    //file_map.close();
    file_graph.close();
    return;
}
