int find_dest_new(int source, int core,int no_nodes, float value)
{ //cout<<core<<"\n";
  float sum = 0;
  float temp_val;
  int i,j;
  int dest = source;
  int selected = 0;
  for(i=0;i<no_nodes;i++)
  {
    temp_val = (graph[core][i]+sum)/total_comm[core];
    sum = sum + graph[core][i];
    if (temp_val>value && graph[core][i] != 0)
      { 
        selected = i+1;
        break;
      }
  }
  //cout<<no_nodes<<"\n";
  if(i>=no_nodes)
  { 
    // cout<<source<<" "<<dest<<"\n";
    // cin.get();
    dest = source;
  }
  else
  {
    for(j=0; j<no_nodes;j++)
    {
    if( selected == mapping[j])
      {
        dest = j;
      }
    }
  }
  //cout<<"dest "<<dest<<" selected "<<selected<<"\n";
  return dest;
}

